import React from 'react';
import {NavLink} from 'react-router-dom';


const Contact = () =>{
    return (
        <div className="notfound">
                <h1 className="display-1">Page Not Found</h1>
                <br></br>
                <p>
                <NavLink href="/"> Go Back to Home</NavLink>
                </p>
        </div>

    );
};

export default Contact;
